class game():

    def __init__(self):
        
        print("Initializing Game Class")
        self.generateInstance()

    def generateInstance(self):
        
        self.instance = [
                        ["0", "0", "0"],
                        ["0", "0", "0"],
                        ["0", "0", "0"]
                        ]
    
    def renderBoard(self, inputInstance = None): #procedure to print the current position of the board

        if inputInstance == None: 

            inputInstance = self.instance
        
        conversion = {
            
            0: " ",
            1: "X",
            -1: "O",
        }
        print("\n\nCurrent Board Position:\n")
        
        for i in range(3):
            
            sublist = []
            for j in inputInstance[i]:
                sublist.append(conversion[j])

            print("321"[i], " |", sublist[0], "|", sublist[1], "|", sublist[2], "|")

            if i != 2:
                print("   ─────────────")
            else:
                print("\n     a   b   c\n\n")

    def copyState(self, gameInstance=None): #generates a copy of the game instance

        if gameInstance == None: 

            gameInstance = self.instance
        
        self.copiedState = []
        for i in range(3):
            sublist = []
            for j in range(3):
                sublist.append(gameInstance[i][j])
            self.copiedState.append(sublist)

        return self.copiedState
        
    def playMove(self, position, turn, inputInstance = None): #plays a move on the inputted board
        
        if inputInstance == None: 

            inputInstance = self.instance

        inputInstance[int(position[0])][int(position[1])] = turn

        self.updatedBoard = inputInstance
        
        return self.updatedBoard
    
    def checkMoveValidity(self, position, inputInstance = None): #checks a move's validity 

        if inputInstance == None: 

            inputInstance = self.instance

        if inputInstance[int(position[0])][int(position[1])] == "0":

            return True
    
        else:

            return False
        
    def checkEndConditions(self, inputInstance = None): #checks to see if a player have won, or if it is a draw

        if inputInstance == None: 

            inputInstance = self.instance

        conditions = [["00", "01", "02"],["10", "11", "12"], ["20", "21", "22"], 
                        ["00", "10", "20"], ["01", "11", "21"], ["02", "12", "22"],
                        ["00", "11", "22"], ["02", "11", "20"]
                        ]
        
        for c in conditions:

            if inputInstance[int(c[0][0])][int(c[0][1])] == "1" and  inputInstance[int(c[1][0])][int(c[1][1])] == "1" and inputInstance[int(c[2][0])][int(c[2][1])] == "1":

                self.result = "CROSSES"
                return ["CROSSES", "1"]

            if inputInstance[int(c[0][0])][int(c[0][1])] == "-1" and  inputInstance[int(c[1][0])][int(c[1][1])] == "-1" and  inputInstance[int(c[2][0])][int(c[2][1])] == "-1":

                self.result = "NOUGHTS"
                return ["NOUGHTS", "-1"]

        draw = True
        for i in inputInstance:
            for j in i:
                if j == "0":
                    draw = False
        if draw == True:
            self.result = "DRAW"
            return ["DRAW", "0"]

        self.result = "NONE"
        return ["NONE", None]
    
    def getPossibleMoves(self, inputInstance = None): #gets the positions of all remaining empty positions
        
        if inputInstance == None: 

            inputInstance = self.instance

        self.possibleMoves = []
        for i in range(3):
            for j in range(3):
                if inputInstance[i][j] == "0":
                    self.possibleMoves.append(str(i) + str(j))

        return self.possibleMoves
    
class NeuralNetwork:

    def __init__(self, save_name, learning_rate, batch_size, training_report_frequency, load, save, output_width=False, input_width=False, h1_width=False, h2_width=False, h3_width=False, h4_width=False):
        
        self.save_name = save_name

        if load:
            
            try: 

                with open(f"{self.save_name}.json", "r") as f:

                    data = json.load(f)

                    self.w1, self.w2, self.w3 = [np.matrix(i) for i in data[0]]
                    self.b1, self.b2, self.b3 = [np.matrix(i) for i in data[1]]

                    print(self.b3)
                
                print("\nSUCCESSFULLY LOADED DATA\n")

            except:
                
                print("\nFAILED TO LOAD DATA\n")

                w1_dimensions = [input_width, h1_width]
                w2_dimensions = [h1_width, h2_width]
                w3_dimensions = [h2_width, output_width]

                self.w1 = 2 * np.matrix(np.random.random(w1_dimensions)) - 1
                self.w2 = 2 * np.matrix(np.random.random(w2_dimensions)) - 1 
                self.w3 = 2 * np.matrix(np.random.random(w3_dimensions)) - 1

                self.b1 = np.matrix(np.random.random((1, h1_width)))
                self.b2 = np.matrix(np.random.random((1, h2_width)))
                self.b3 = np.matrix(np.random.random((1,output_width)))


        else:
            
            print("\nASSIGNING RANDOM VALUES\n")
            w1_dimensions = [input_width, h1_width]
            w2_dimensions = [h1_width, h2_width]    
            w3_dimensions = [h2_width, output_width]

            
        
            self.w1 = 2 * np.matrix(np.random.random(w1_dimensions)) - 1
            self.w2 = 2 * np.matrix(np.random.random(w2_dimensions)) - 1 
            self.w3 = 2 * np.matrix(np.random.random(w3_dimensions)) - 1
            
            self.b1 = np.matrix(np.random.uniform(0,1,(1, h1_width)))
            self.b2 = np.matrix(np.random.uniform(0,1,(1, h2_width)))
            self.b3 = np.matrix(np.random.uniform(0,1,(1, output_width)))
            
        if save:

            self.save = True

        else: 

            self.save = False

        self.last_average_loss = 0
        self.end = False

        self.learning_rate = learning_rate
        self.training_report_frequency = training_report_frequency
        self.batch_size = batch_size
        self.beta1 = 0.9
        self.beta2 = 0.999
        self.epsilon = 0.0000001
        
        self.parameter_width = 6

        self.m = [0 for i in range(self.parameter_width)]
        self.v = [0 for i in range(self.parameter_width)]

        self.t = 1

    def _batch(self, batch_size, i, t):
    
        sample_size = len(i)

        full_batches = sample_size // batch_size


        if sample_size % batch_size == 0:

            i, t = [i[a:a+batch_size] for a in range(full_batches)],  [t[a:a+batch_size] for a in range(full_batches)]
            
        else: 
            
            i, t = [i[a:a+batch_size] for a in range(full_batches)] + [i[batch_size*full_batches:]], [t[a:a+batch_size] for a in range(full_batches)] + [t[batch_size*full_batches:]]

        return i, t



    def _relu(self, x):

        return np.maximum(0,x)

    def _relu_deriv(self, x):

        return np.greater(x, 0).astype(int).T
    
    def _softmax(self,x):

        return(np.exp(x - np.max(x)) / np.exp(x - np.max(x)).sum())
    
    def predict(self, input_vector):

        self.h1_z = np.dot(input_vector, self.w1) + self.b1
        self.h1_activation = self._relu(self.h1_z)

        self.h2_z = np.dot(self.h1_activation, self.w2) + self.b2
        self.h2_activation = self._relu(self.h2_z)

        self.output_z = np.dot(self.h2_activation, self.w3) + self.b3
        self.output_activation = self._softmax(self.output_z)

        return self.output_activation
    
    def _compute_cross_entropy_loss(self, target_list, prediction_list):
        
        target_list = np.float_(target_list)
        prediction_list = np.float_(prediction_list)
        losses = []
        
        for t,p in zip(target_list, prediction_list):
            loss = -np.sum(t * np.log(p))
            losses.append(loss)
            
        return np.sum(losses)
    
    def _compute_gradients(self, input_vector, target):
        

        derror_dprediction = (self.output_activation - target).T

        derror_h2Activation = (self.w3 * derror_dprediction)

        derror_h1Activation = (self.w2 * derror_h2Activation)

        derror_dw3 = derror_dprediction  * self.h2_activation

        derror_dw2 = derror_h2Activation * self.h1_activation
 
        derror_dw1 = derror_h1Activation * input_vector
        
        derror_db1 = derror_h1Activation
        derror_db2 = derror_h2Activation
        derror_db3 = derror_dprediction
        return np.array([derror_dw1, derror_db1, derror_dw2, derror_db2, derror_dw3, derror_db3], dtype=object)
    
    def _update_parameters(self, g):

        self.m = np.multiply(self.beta1, self.m) + np.multiply(1-self.beta1, g)

        np.multiply(self.beta2, self.v)

        self.v = np.multiply(self.beta2, self.v) + np.multiply(1-self.beta2, np.array([np.square(x) for x in g], dtype=object))

        mhat = np.divide(self.m, 1-self.beta1**self.t)
        vhat = np.divide(self.v, 1-self.beta2**self.t)


        self.w1 = self.w1 - (mhat.item(0) * self.learning_rate / (np.sqrt(vhat.item(0)) + self.epsilon)).T
        self.b1 = self.b1 - (mhat.item(1) * self.learning_rate / (np.sqrt(vhat.item(1)) + self.epsilon)).T
        self.w2 = self.w2 - (mhat.item(2) * self.learning_rate / (np.sqrt(vhat.item(2)) + self.epsilon)).T
        self.b2 = self.b2 - (mhat.item(3) * self.learning_rate / (np.sqrt(vhat.item(3)) + self.epsilon)).T
        self.w3 = self.w3 - (mhat.item(4) * self.learning_rate / (np.sqrt(vhat.item(4)) + self.epsilon)).T
        self.b3 = self.b3 - (mhat.item(5) * self.learning_rate / (np.sqrt(vhat.item(5)) + self.epsilon)).T
        
        self.t += 1

    def train(self, iterations, input_vectors, targets):
        
        total_trains = 0
        number_of_batches = len(input_vectors)

        while self.end == False:

            for batch_count in range(number_of_batches):

                input_size = len(input_vectors[batch_count])
                
                total_epoch_gradient_adjustment = np.array([0 for i in range(self.parameter_width)])
                
                total_epoch_loss = 0

                for current_iteration in range(len(input_vectors[batch_count])):

                    input_vector = np.matrix(input_vectors[batch_count][current_iteration])

                    target = np.matrix(targets[batch_count][current_iteration])

                    prediction = self.predict(input_vector)

                    entropy_loss = self._compute_cross_entropy_loss([target], [prediction])

                    gradient_adjustment = self._compute_gradients(input_vector, target)
                
                    total_epoch_gradient_adjustment = total_epoch_gradient_adjustment + gradient_adjustment
                    total_epoch_loss = total_epoch_loss + entropy_loss

                self.epoch_gradient_adjustment = total_epoch_gradient_adjustment / input_size
                self.average_loss_over_epoch = total_epoch_loss / input_size
                
                self._update_parameters(self.epoch_gradient_adjustment)

                if total_trains % self.training_report_frequency == 0:
                    
                    entropy_change = self.average_loss_over_epoch - self.last_average_loss
                    self.last_average_loss = self.average_loss_over_epoch
                    
                    if total_trains != 0:

                        accuracy = 100 * sum([not (np.argmax(targets[batch_count][x]) ^ np.argmax(self.predict(input_vectors[batch_count][x]))).tolist() for x in range(input_size)]) / input_size
                        print(f"\nEPOCH: {total_trains},  ENTROPY LOSS: {self.average_loss_over_epoch}, DELTA_ENTROPY_LOSS_OVER_BATCH: {entropy_change}  ACCURACY: {accuracy}")
                    
                total_trains = total_trains + 1

                if total_trains > iterations:

                    self.end = True

        if self.save:

            print("\nSAVING DATA\n")

            with open(f"{self.save_name}.json", "w") as f:

                json.dump([[np.array(neural_network.w1).tolist(), np.array(neural_network.w2).tolist(), np.array(neural_network.w3).tolist()], [np.array(neural_network.b1).tolist(), np.array(neural_network.b2).tolist(),np.array(neural_network.b3).tolist()]], f)


